import axios from 'axios';
import React from 'react';

class App extends React.Component{
    constructor(props){
        super(props);
    }

    count = 0;

    render(){
        return (
        <div className="App">
          <h2>Health Check</h2>
          <input type="button" value="Test Backend" onClick={this.healthCheck()}/>
        </div>
        );
    }

    healthCheck() {
        //axios
        //    .get("https://localhost:8000/")
        //    .then(response => console.log(response.data));
        count = count + 1;
        console.log(count);
    }
}


export default App;
